DROP TABLE IF EXISTS `pms_report`;
CREATE TABLE `pms_report` (
  `report_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) DEFAULT NULL COMMENT '用户ID',
  `dept_id` int(11) DEFAULT NULL COMMENT '部门ID',
  `project_id` int(11) DEFAULT NULL COMMENT '项目ID',
  `staff_sched_id` int(11) DEFAULT NULL COMMENT '排期任务ID',
  `report_title` varchar(300) COLLATE utf8_bin DEFAULT NULL COMMENT '标题',
  `report_content` text CHARACTER SET utf8mb4 COMMENT '内容',
  `report_work_hour` double(10,1) DEFAULT '0.0' COMMENT '工时',
  `report_start_time` datetime DEFAULT NULL COMMENT '起始时间',
  `report_end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `del_flag` char(1) CHARACTER SET utf8mb4 DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`report_id`),
  KEY `projectId` (`project_id`) USING BTREE,
  KEY `userId` (`user_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=11547 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='日报表';

