INSERT INTO `pms_report` VALUES ('55', '11', '103', '2', null, '根据传感器数量及状态计算多个图标显示规则', '1.实时监测应力应变背景填充需要根据规则进行计算。\r\n2.获取UC预警规则，从已选中传感器中对比一级，二级，三级，正常的最大与最小值\r\n3.用最大最小值绝对值进行选择传感器的最高点与最低点进行比较，筛选出绝对值之前的值进行赋值\r\n4.一个图标最多十二个测点，则需要根据最后循环的多个图表进行拆分汇总一一对应\r\n5.协力的工作事宜。关闭所有传感器管理BUG，达到验收标准！', '13.0', '2024-02-28 18:08:08', '2024-02-28 18:08:08', '0', '', '2024-02-28 18:14:38', '', null, null);
