INSERT INTO `pms_report` VALUES ('169', '10', '103', '12', null, '理工大学多轴疲劳程序开发研讨会议', '1.多轴疲劳解算程序需集成到SAM有限元开发软件中\r\n2.SAM使用的编程语言是C++，框架是QT\r\n3.获取SAM中模型和应力数据是通过API接口方式获取，数据格式遵循HDF5文档\r\n4.现有两种开发方式：\r\n①本地独立开发，定义好入参数据格式，开发完成后将.cpp和.h，以及.ui文件集成到SAM软件中\r\n②在SAM软件基础上做二次开发，需提前搭建好开发环境，了解SAM程序接口', '2.0', '2024-03-06 14:00:00', '2024-03-06 16:00:00', '0', '', '2024-03-07 08:52:20', '', '2024-03-07 09:21:32', null);
