INSERT INTO `pms_report` VALUES ('172', '11', '103', '2', null, '历史查询阴极保护页面关联', '1.历史查询阴极保护涉及选项卡比较多，其工作量主要在于点A类选项卡中存在子类，子类中有小时，半天，一天周，四种状态，每切换一个需要判断所在子类并且还要是当前大分类下的子类，每个子分类对应多个接口的调用与传参不一。若不加判断则切换时会产生没必要的请求，久而久之会积少成多造成页面负载导致浏览器崩溃。', '14.5', '2024-03-06 08:30:00', '2024-03-06 23:30:00', '0', '', '2024-03-07 09:27:06', '', null, null);
