INSERT INTO `pms_report` VALUES ('6592', '37', '103', '62', '156', '报工系统文件浏览与学习', '了解mes报工系统资料，当前资料已经全部阅读及初步了解完成，以及与开发人员对报工小程序进行初次了解，并于黄飞进行第一次关于mes系统的一些问题沟通。 在阅读资料时提出了部分不理解的问题如下\n\n1，在文档中的原型贴中发现，施工人员/工时/数量三个字段的统计报表，提出疑问不同的工种人效记录的方式有所不同，混在一起统计是否会产生工种差异化问题。（当前未考虑到此处）\n2，若工艺中存在两道工序，而实际作业中每一道工序完成后需要进行质检，如果在工序一完工后，进入工序二的步骤此时发现工序一完工质检有问题，当前如何解决。（所有工序完工后进行质检，最后追责）\n3，车间工人流动性较大，人员信息统一推介金蝶系统，是否会造成大量垃圾数据的现象。（会有专门人员人工处理这部分信息）\n4，一个工单中工艺是否会存在多个版本，产生工艺对应问题（回复：暂时应该不会出现工艺版本迭代情况）\n5，在下达工单时，是否会存在根据库存进行完工的测算，可能会出现库存料不足无法进入进行实际作业问题（需与工厂详细沟通此问题）\n6，若一道工序中涉及多名作业人员，假设工单要求产出5件，张三产出3件，李四产出2件，此时小程序中无法体现', '5.0', '2025-03-31 08:30:00', '2025-03-31 17:30:00', '0', 'wangjunfeng', '2025-03-31 17:34:59', 'wangjunfeng', '2025-06-19 09:45:22', null);
