INSERT INTO `pms_report` VALUES ('7145', '36', '107', '49', null, '激光雷达与4D雷达研究', '1、针对激光雷达参与靠离泊动作进行讨论调研；对于激光雷达在靠离泊中使用的选型品牌侧重为：大疆及图达通，但是在浓雾天气中效果都会有一定的折损，并且效果折损比例味精测试暂不能确定，但是视场角足够，船舶过长的话可能单侧需要两台，并且我方需要具备点云数据二次开发能力\n2、关于4D毫米波雷达的使用，4D毫米波雷达基于普通毫米波雷达的基础功能上提供了高度差的功能，可以区分水面及码头的位置差，但是没有经过实际的验证，优点是成本低，缺点是功能实现程度暂不可知，对比激光雷达需要更全面的测试过程', '8.0', '2025-05-06 08:30:00', '2025-05-06 17:30:00', '0', 'yuguansheng', '2025-05-07 20:09:42', '', null, null);
